import React, { useState, useEffect } from 'react';

import '../../core/CoreStyle.css';
import { C_Button } from '../../core/Components/C_Button';
import { C_Modal } from '../../core/Components/C_Modal';
import { C_TextField } from '../../core/Components/C_TextField';
import { C_SelectVehicle } from '../../core/Components/C_SelectFields';
import { C_SelectVehicleBrand } from '../../core/Components/C_SelectFields';
import { makeStyles } from '@material-ui/core';
import helper from '../../core/Helper';

const useStyles = makeStyles((theme) => ({
    div: {
        height: "60px",
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        padding: "0px 10px 0px 10px",
    },

    page: {
        width: "100%",
        height: "100%",
        background: theme.palette.page.light,
    },

    text: {
        
    },

}));

export function Clients(props) {
    const classes = useStyles();

    const [showModalClient, setShowModalClient] = useState(false);

    useEffect((err, data) => {
        // helper.Get("/api/client/list", { get: "success", secondTest: 1 }, false, (err, ret) => {
        //     console.log("err", err);
        //     console.log("ret", ret);
        // });
    }, []);

    function showModal() {
        setShowModalClient(true);
    }

    function registerClient() {
        // helper.Post("/api/client/create", { Name: "the first", age: 18, state: "SC" }, false, (err, ret) => {
        //     console.log("err", err);
        //     console.log("ret", ret);
        // });
    }

    return (
        <div className={classes.page}>

            <span className={`${classes.div} fade-in`}>
                <p>Clientes</p>
                <C_Button onClick={showModal} icon="person_add" label="Cadastrar" />
            </span>

            <C_Modal onSave={registerClient} onClose={() => setShowModalClient(false)} tittle={"Novo Cliente"} show={showModalClient}>

                <div style={{ marginBottom: 20 }}>
                    <C_TextField outoFocus={true} style={{ width: "100%" }} label="Nome" icon="person" placeholder="" />
                </div>
                <div style={{ width: "100%", display: "flex", alignItems: "center", marginBottom: 20 }}>
                    <div style={{ width: "49%", marginRight: "2%" }}>
                        <C_TextField style={{ width: "100%" }} label="Celular" icon="phone_iphone" placeholder="" />
                    </div>
                    <div style={{ width: "49%" }}>
                        <C_TextField style={{ width: "100%" }} label="Email" icon="email" placeholder="" />
                    </div>
                </div>

                <div style={{ width: "100%", display: "flex", alignItems: "center", marginBottom: 20 }}>
                    <div style={{ width: "49%", marginRight: "2%" }}>
                        <C_SelectVehicle style={{ width: "100%" }} />
                    </div>
                    <div style={{ width: "49%" }}>
                        <C_SelectVehicleBrand style={{ width: "100%" }} label="Marca" icon="email" placeholder="" />
                    </div>
                </div>

            </C_Modal>
        </div>
    );
}
